    e.preventDefault()
    if(value<77500){
      let calc=(value-value+2100)
      setCalc(calc.toFixed(1))
     }else {
     let calc=(value*0.027)
    setCalc(calc.toFixed(1))
     }
     if(value>37500){
        let rat=(value*0.014/3)
        setRat(rat.toFixed(1))
        }else{
            let rat=((value-value+525)/3)
            setRat(rat.toFixed(1))
        }
    
    } 
    
